var modalPhoneInput = document.getElementById('modal-tel');
if (modalPhoneInput) {
  var im = new Inputmask("+7 (999)-999-99-99");
  im.mask(modalPhoneInput);
}
var validateForm = new JustValidate(".modal-form__form", {
  rules: {
    name: {
      required: true,
      minLength: 2,
      maxLength: 20
    },
    tel: {
      required: true,
      "function": function _function() {
        var phone = modalPhoneInput.inputmask.unmaskedvalue();
        return Number(phone) && phone.length === 10;
      }
    },
    checkbox: {
      required: true
    }
  },
  focusWrongField: true,
  messages: {
    name: {
      required: '"Имя" обязательно для заполнения',
      minLength: '"Имя" введено некорректно, минимум 2 знака',
      maxLength: '"Имя" введено некорректно, максимум 20 знаков'
    },
    tel: {
      required: '"Телефон" обязательно для заполнения',
      "function": 'Заполните "Телефон"'
    },
    checkbox: {
      required: 'Необходимо принять "Пользовательское соглашение"'
    }
  },
  colorWrong: '#FF6972'
});
